sys_variable_value.value:
(function execute(inputs, outputs) {
    var vendorUtils = new VendorUtils();
    var vendorId = inputs.vendorid;

    // Get vendor details as a JSON string
    var details = vendorUtils.getVendorById(vendorId);
    outputs.vendordetails = details ? JSON.stringify(details) : "";

    // Return string rather than boolean
    var available = vendorUtils.isVendorAvailable(vendorId);
    outputs.vendoravailable = available ? "true" : "false";
})(inputs, outputs);

